#3 hearts

	.space 262144

	#STACK
	stack_beg:
       				.word   0 : 40
	stack_end:
	
	#DATA
	loca: .word  268501024
	min:			.word	0		#Max value in the sequence (initially set to 0)
	display: 		.space 524288
	#STRINGS
	win:		.asciiz "Congrats!"	#Win prompt
	lose:		.asciiz "Hard luck :("	#Lose prompt
	intro:		.asciiz "Welcome! Enter 1 for easy, 2 for medium, 3 for hard. Enter 0 to quit."
	howToPlay:	.asciiz "To choose the sequence enter: \n0 for yellow \n1 for blue \n2 for green \n3 for red \n"
	error:		.asciiz "Invalid input, please try again."
	inputPrompt:	.asciiz "Enter sequence: "
	
	#HEX values for colors	
	colorTable: 	.word 0xFFFF00 #Yellow 
 		    	.word 0x0000FF #Blue   
 			.word 0xFF0000 #Red    
 			.word 0x00FF00 #Green  
 	
        .text
        main:
        
        #Initialize stack
	la	$sp, stack_end	
	la      $t1, frameBuffer
	
	color:
	li    $t3, 0x00FFFFFF


	count:
	li    $t6, 131072      
	li    $t9, 0          
	li    $t2, 0          
	li    $t5, 0           
	# white background
	white:
	sw    $t3, 0     ($t1) 
	addi  $t1, $t1,     4  
	addi  $t9, $t9,     1  
	beq   $t9, $t6, colorMain 
	j     white        
	colorMain:

	# Yellow square 
	square:
	li $a0,150 
	li $a1,90 
	li $a2,150 
	li $a3,90  
	j s
	li $v0,10
	syscall
	
	s:
	li $t0, 0xFFFFFF00
	la $t1,frameBuffer
	add $a1,$a1,$a0
	add $a3,$a3,$a2
	sll $a0,$a0,2 
	sll $a1,$a1,2
	sll $a2,$a2,11 
	sll $a3,$a3,11
	addu $t2,$a2,$t1 
	addu $a3,$a3,$t1
	addu $a2,$t2,$a0 
	addu $a3,$a3,$a0
	addu $t2,$t2,$a1 
	li $t4,0x800 

	squareYloop:
	move $t3,$a2

	squareXloop:
	sw $t0,($t3)
	addiu $t3,$t3,4
	bne $t3,$t2,squareXloop
	addu $a2,$a2,$t4 
	addu $t2,$t2,$t4 
	bne $a2,$a3,squareYloop


	# Blue square

	square1:
	li $a0,150 
	li $a1,90
	li $a2,30 
	li $a3,90  
	j s1
	li $v0,10
	syscall
	
	s1:
	li $t0, 0xFF0000FF
	la $t1,frameBuffer
	add $a1,$a1,$a0 
	add $a3,$a3,$a2
	sll $a0,$a0,2 
	sll $a1,$a1,2
	sll $a2,$a2,11 
	sll $a3,$a3,11
	addu $t2,$a2,$t1 
	addu $a3,$a3,$t1
	addu $a2,$t2,$a0 
	addu $a3,$a3,$a0
	addu $t2,$t2,$a1 
	li $t4,0x800 
	
	squareYloop1:
	move $t3,$a2 
	
	squareXloop1:
	sw $t0,($t3)
	addiu $t3,$t3,4
	bne $t3,$t2,squareXloop1
	addu $a2,$a2,$t4 
	addu $t2,$t2,$t4 
	bne $a2,$a3,squareYloop1

	
	# Green square

	square2:
	li $a0,280 
	li $a1,90
	li $a2,30 
	li $a3,90  
	j s2
	li $v0,10
	syscall

	s2:
	li $t0,  0xFF00FF00
	la $t1,frameBuffer
	add $a1,$a1,$a0 
	add $a3,$a3,$a2
	sll $a0,$a0,2 
	sll $a1,$a1,2
	sll $a2,$a2,11 
	sll $a3,$a3,11
	addu $t2,$a2,$t1 	
	addu $a3,$a3,$t1
	addu $a2,$t2,$a0 
	addu $a3,$a3,$a0
	addu $t2,$t2,$a1 
	li $t4,0x800 
	
	squareYloop2:
	move $t3,$a2 

	squareXloop2:
	sw $t0,($t3)
	addiu $t3,$t3,4
	bne $t3,$t2,squareXloop2
	addu $a2,$a2,$t4 
	addu $t2,$t2,$t4
	bne $a2,$a3,squareYloop2


	# Red square 

	square3:
	li $a0,280 
	li $a1,90 
	li $a2,150 
	li $a3,90  
	j s3
	li $v0,10
	syscall

	s3:
	li $t0,0xFFFF0000
	la $t1,frameBuffer
	add $a1,$a1,$a0 
	add $a3,$a3,$a2
	sll $a0,$a0,2 
	sll $a1,$a1,2
	sll $a2,$a2,11 
	sll $a3,$a3,11
	addu $t2,$a2,$t1 
	addu $a3,$a3,$t1
	addu $a2,$t2,$a0 
	addu $a3,$a3,$a0
	addu $t2,$t2,$a1 
	li $t4,0x800 

	squareYloop3:
	move $t3,$a2

	squareXloop3:
	sw $t0,($t3)
	addiu $t3,$t3,4
	bne $t3,$t2,squareXloop3
	addu $a2,$a2,$t4 
	addu $t2,$t2,$t4 
	bne $a2,$a3,squareYloop3
	
	

	mainMenu:
	
	#New line 
	li		$v0, 11			
	addi		$a0, $0, 0xA		
	syscall	
	#PRINT INTRO
	la		$a0, intro	
	li		$v0, 4			
	syscall					
	
	#GET INPUT
	li		$v0, 5			
	syscall		
	
	#CHECK USER INPUT
	beq		$v0, 0, exit		# QUIT
	beq		$v0, 1, easy		# Easy
	beq		$v0, 2, medium		# Medium
	beq		$v0, 3, hard		# Hard
	j		invalidNum		# Invalid input jump to error handling
	
	#Easy level
	easy:
	li		$t5, 3			#3 colors in the sequence	
	j		continue	
	
	
	#Medium level
	medium:
	li		$t5, 5			#5 colors in the sequence
	j		continue	
	
	#Hard level
	hard:
	li		$t5, 7			#7 colors in the sequence
	j		continue	
	
	#continue the game with the chosen sequence
	continue:
	la		$a0, howToPlay	
	li		$v0, 4			
	syscall		#print game rules
	
	#Delay before execution
	li		$a0, 800		#Sleep for 800ms
	li		$v0, 32			#Syscall for sleep
	syscall	
	
	li		$t0, 0
	lw		$t6, min		#Counter
	gamePlay:
	li		$a0, 800		#Sleep for 800ms
	li		$v0, 32			#Syscall for sleep
	syscall	
	li $a1, 4	#Random Int Range [0-$a1) [0-3]
	li $v0, 42	
	syscall		#$a0 has the random integer from 0 to 3
	sll $t8, $t7, 2
	sw $a0, 268501024 ($t8)
	addi $t7, $t7, 1
	beq $a0, 0, yellow
	beq $a0, 1, blue 
	beq $a0, 2, green
	beq $a0, 3, red 
	continueGame:
	addi $t6, $t6, 1
	bne $t6, $t5, gamePlay
	jal userInput


	userInput:				
	li	$t3, 0
	li 	$t6, 0
	la	$a0, inputPrompt	#Load address of intoPrompt into $a0
	li	$v0, 4			#Load print string syscall
	syscall				#Execute
	
	#GET USER INPUT
	inputLoop:
	li	$v0, 5			#Load syscall for read int
	syscall		
	move $t0,$v0
	sll $t4, $t3, 2
	lw $t1, 268501024 ($t4)
	addi $t3, $t3, 1
	bne  $t0, $t1, loser
	addi $t6, $t6, 1
	beq  $t6, $t5, winner
	jal inputLoop
	
	
	#LOSE
	loser:
	la		$a0, lose		
	li		$v0, 4			
	syscall					#print lose prompt
	ShowBg2:
	la $t0,frameBuffer 
	la $t4,bg2
	li $t1,262144
      
	while2:
	lw $t2,0($t4)
	sw $t2, 0($t0)
	addi $t0,$t0,4
	addi $t1,$t1,-1
	addi $t4,$t4,4
	bnez $t1, while2
	#wait 1s before clearing screen
	li		$a0, 1000		#Sleep for 1s
	li		$v0, 32			#Syscall for sleep
	syscall		
	#New line and clear
	li		$v0, 11			
	addi		$a0, $0, 0xA		
	syscall					#print a new empty line
	j		clearReg		#clear registers to start a new game
	
	#WIN
	winner:
	la		$a0, win		
	li		$v0, 4			
	syscall					#print win prompt
	ShowBg:
	la $t0,frameBuffer 
	la $t4,bg
	li $t1,262144
      
	while:
	lw $t2,0($t4)
	sw $t2, 0($t0)
	addi $t0,$t0,4
	addi $t1,$t1,-1
	addi $t4,$t4,4
 	bnez $t1, while
 	#wait 1s before clearing screen
	li		$a0, 1000		#Sleep for 1s
	li		$v0, 32			#Syscall for sleep
	syscall		
	#New line and clear
	li		$v0, 11			
	addi		$a0, $0, 0xA		
	syscall					#print a new empty line
	j		clearReg		#clear registers to start a new game
	
	#INVALID NUM (input != 0||1)
	invalidNum:
	la		$a0, error	
	li		$v0, 4			
	syscall					#print error message 
	
	#New line and clear
	li		$v0, 11			
	addi		$a0, $0, 0xA		
	syscall					#print a new empty line
	j		clearReg		#clear registers to start a new game
	
	#squares blinking procedure
	yellow:
		

	# Start loop to draw the white square multiple times
	li $s0, 0           # Initialize counter
	li $t0, 10000        # Set loop count
    

	loop:
	beq $s0, $t0, draw_square # If counter equals loop count, exit loop
    
	# Draw the white square
	li $a0, 150 
	li $a1, 90
	li $a2, 150 
	li $a3, 90  
 
    
	addi $s0, $s0, 1        # Increment counter
	j loop                  # Jump back to loop
    

	# Function to draw a square
	draw_square:


	li $t0,0xFFFFFFFF
	la $t1,frameBuffer
	add $a1,$a1,$a0 
	add $a3,$a3,$a2
	sll $a0,$a0,2 
	sll $a1,$a1,2
	sll $a2,$a2,11 
	sll $a3,$a3,11
	addu $t2,$a2,$t1 
	addu $a3,$a3,$t1
	addu $a2,$t2,$a0 
	addu $a3,$a3,$a0
	addu $t2,$t2,$a1 
	li $t4,0x800 


	squareYloop4:
	move $t3,$a2 

	squareXloop4:
	sw $t0,($t3)
